// src/App.js

import React from 'react';
import './App.css';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import TopBar from './TopBar';
import SignIn from './SignIn';
import SignUp from './SignUp'; // Import the SignUp component
import FunkoPops from './FunkoPops'; // Import the Funko Pops component

function App() {
  return (
    <Router>
      <div className="App">
        <TopBar />
        <Switch>
          <Route path="/sign-in" component={SignIn} />
          <Route path="/sign-up" component={SignUp} /> {/* Add the route for Sign Up */}
          <Route path="/funko-pops" component={FunkoPops} /> {/* Add the route for Funko Pops */}
        </Switch>
      </div>
    </Router>
  );
}

export default App;
